import React from 'react'

function CourseSearch() {
    return (
        <div class="courses-search">
            <form action="#">
                <input type="text" placeholder="Search your course" />
                <button><i class="flaticon-magnifying-glass"></i></button>
            </form>
        </div>
    )
}

export default CourseSearch
